        <img className="card-img-top" src={props.src} />
        <div className="card-body">
          <h1 className="card-title">{props.name}</h1>
          <p className="card-text">{props.description}</p>
          <h3>{props.price}</h3>
          <button className="btn btn-primary">Add</button>
        </div>
      </div>

  );
};

